INSERT INTO `articles` VALUES ('3', '麦谷OA系统可以开始测试 - 包括进度说明', '2', '<p>已完成并测试通过部分：</p>\r\n<ol><li><br />\r\n</li>\r\n</ol>\r\n<p>已完成需测试部分：</p>\r\n<ol><li>订单流程部分</li>\r\n<li>总经理、人力资源系统设置</li>\r\n<li>文章内容类（公告， 单页， 分享， 等等）</li>\r\n<li>请假单</li>\r\n<li>...<br />\r\n</li>\r\n</ol>\r\n<p>进行中功能</p>\r\n<ol><li>搜索功能</li>\r\n<li>个人工作计划</li>\r\n<li>短信， 通知功能</li>\r\n<li>一些细节调整</li>\r\n</ol>\r\n<p>PS: </p>\r\n<ol><li>客户登陆为： 用户名为录入时候的<span style=\\\"background-color:#e53333;color:#ffffff;\\\">客户负责人姓名加订单ID</span>， 密码为<span style=\\\"background-color:#e53333;color:#ffffff;\\\">&nbsp; MG-客服ID-订单ID&nbsp;&nbsp; </span>&nbsp;&nbsp; 如： MG-1-1 (戴越ID是1)<br />\r\n</li>\r\n</ol>', '2', 'mg-oa-begin-test', '2011-05-07 10:37:51', '2011-05-10 16:53:45');
INSERT INTO `articles` VALUES ('4', 'OA使用的一些说明', '6', '<p>1. 登陆后请尽快修改自己的默认密码</p>\r\n<p>2. 由于服务器对一些类型文件的MIME不支持， 会导致上传的文件不能访问， 另外出于节省服务器空间的原因， <span style=\\\"font-weight:bold;\\\">建议在有上传文件的功能时（上传图片除外）将文件打包上传。</span></p>\r\n<p>&nbsp;</p>', '16', 'OA-manual-by-xiaolan', '2011-05-17 16:29:26', '2011-05-17 16:29:44');
INSERT INTO `articles` VALUES ('5', '麦谷网络计算机管理规定', '3', '<p style=\\\"text-indent:88pt;margin:0cm 0cm 0pt;mso-char-indent-count:4.0;\\\" class=\\\"MsoNormal\\\"><span lang=\\\"EN-US\\\"><?xml:namespace prefix = o ns = \\\"urn:schemas-microsoft-com:office:office\\\" /><o:p></o:p></span></p>\r\n<p style=\\\"margin:0cm 0cm 0pt;\\\" class=\\\"MsoNormal\\\"><span style=\\\"font-size:small;\\\"><span style=\\\"font-family:宋体;mso-ascii-font-family:\\\'Times New Roman\\\';mso-hansi-font-family:\\\'Times New Roman\\\';\\\">第</span><span lang=\\\"EN-US\\\"><span style=\\\"font-family:\\\'Times New Roman\\\';\\\">1</span></span><span style=\\\"font-family:宋体;mso-ascii-font-family:\\\'Times New Roman\\\';mso-hansi-font-family:\\\'Times New Roman\\\';\\\">条</span><span lang=\\\"EN-US\\\"><span style=\\\"mso-spacerun:yes;\\\"><span style=\\\"font-family:\\\'Times New Roman\\\';\\\">&nbsp; </span></span></span><span style=\\\"font-family:宋体;mso-ascii-font-family:\\\'Times New Roman\\\';mso-hansi-font-family:\\\'Times New Roman\\\';\\\">公司计算机以及计算机网络资源是公司用于工作目的的投资，只能用于工作。个人由于一般业务学习、娱乐等而需用计算机以及计算机网络的必须在自己家中进行。为规范公司计算机以及计算机网络的管理，确保计算机以及计算机网络资源高效安全地用于工作，特制订本规定。</span></span></p>\r\n<p style=\\\"margin:0cm 0cm 0pt;\\\" class=\\\"MsoNormal\\\"><span lang=\\\"EN-US\\\"><o:p><span style=\\\"font-family:\\\'Times New Roman\\\';font-size:small;\\\">&nbsp;</span></o:p></span></p>\r\n<p style=\\\"margin:0cm 0cm 0pt;\\\" class=\\\"MsoNormal\\\"><span style=\\\"font-size:small;\\\"><span style=\\\"font-family:宋体;mso-ascii-font-family:\\\'Times New Roman\\\';mso-hansi-font-family:\\\'Times New Roman\\\';\\\">第</span><span lang=\\\"EN-US\\\"><span style=\\\"font-family:\\\'Times New Roman\\\';\\\">2</span></span><span style=\\\"font-family:宋体;mso-ascii-font-family:\\\'Times New Roman\\\';mso-hansi-font-family:\\\'Times New Roman\\\';\\\">条</span><span lang=\\\"EN-US\\\"><span style=\\\"mso-spacerun:yes;\\\"><span style=\\\"font-family:\\\'Times New Roman\\\';\\\">&nbsp; </span></span></span><span style=\\\"font-family:宋体;mso-ascii-font-family:\\\'Times New Roman\\\';mso-hansi-font-family:\\\'Times New Roman\\\';\\\">本规定涉及的网络范围包括公司各办公地点的局域网、办公地点之间的广域连接、公司各片区和办事处广域网、移动网络接入、</span><span lang=\\\"EN-US\\\"><span style=\\\"font-family:\\\'Times New Roman\\\';\\\">Internet</span></span><span style=\\\"font-family:宋体;mso-ascii-font-family:\\\'Times New Roman\\\';mso-hansi-font-family:\\\'Times New Roman\\\';\\\">出口以及网络上提供的各类服务和</span><span lang=\\\"EN-US\\\"><span style=\\\"font-family:\\\'Times New Roman\\\';\\\">Internet</span></span><span style=\\\"font-family:宋体;mso-ascii-font-family:\\\'Times New Roman\\\';mso-hansi-font-family:\\\'Times New Roman\\\';\\\">电子邮件、代理服务、</span><span lang=\\\"EN-US\\\"><span style=\\\"font-family:\\\'Times New Roman\\\';\\\">OA</span></span><span style=\\\"font-family:宋体;mso-ascii-font-family:\\\'Times New Roman\\\';mso-hansi-font-family:\\\'Times New Roman\\\';\\\">办公平台等。</span></span></p>\r\n<p style=\\\"margin:0cm 0cm 0pt;\\\" class=\\\"MsoNormal\\\"><span lang=\\\"EN-US\\\"><o:p><span style=\\\"font-family:\\\'Times New Roman\\\';font-size:small;\\\">&nbsp;</span></o:p></span></p>\r\n<p style=\\\"margin:0cm 0cm 0pt;\\\" class=\\\"MsoNormal\\\"><span style=\\\"font-size:small;\\\"><span style=\\\"font-family:宋体;mso-ascii-font-family:\\\'Times New Roman\\\';mso-hansi-font-family:\\\'Times New Roman\\\';\\\">第</span><span lang=\\\"EN-US\\\"><span style=\\\"font-family:\\\'Times New Roman\\\';\\\">3</span></span><span style=\\\"font-family:宋体;mso-ascii-font-family:\\\'Times New Roman\\\';mso-hansi-font-family:\\\'Times New Roman\\\';\\\">条</span><span lang=\\\"EN-US\\\"><span style=\\\"mso-spacerun:yes;\\\"><span style=\\\"font-family:\\\'Times New Roman\\\';\\\">&nbsp; </span></span></span><span style=\\\"font-family:宋体;mso-ascii-font-family:\\\'Times New Roman\\\';mso-hansi-font-family:\\\'Times New Roman\\\';\\\">行政部作为公司网络的规划、设计、建设和管理部门，有权对公司网络运行情况进行监督和控制。行政部有权对公司网络上的信息进行检查和备案，任何引入与发出的邮件，都有可能被备份审查。</span></span></p>\r\n<p style=\\\"margin:0cm 0cm 0pt;\\\" class=\\\"MsoNormal\\\"><span lang=\\\"EN-US\\\"><o:p><span style=\\\"font-family:\\\'Times New Roman\\\';font-size:small;\\\">&nbsp;</span></o:p></span></p>\r\n<p style=\\\"margin:0cm 0cm 0pt;\\\" class=\\\"MsoNormal\\\"><span style=\\\"font-size:small;\\\"><span style=\\\"font-family:宋体;mso-ascii-font-family:\\\'Times New Roman\\\';mso-hansi-font-family:\\\'Times New Roman\\\';\\\">第</span><span lang=\\\"EN-US\\\"><span style=\\\"font-family:\\\'Times New Roman\\\';\\\">4</span></span><span style=\\\"font-family:宋体;mso-ascii-font-family:\\\'Times New Roman\\\';mso-hansi-font-family:\\\'Times New Roman\\\';\\\">条</span><span style=\\\"font-family:\\\'Times New Roman\\\';\\\"> </span><span style=\\\"font-family:宋体;mso-ascii-font-family:\\\'Times New Roman\\\';mso-hansi-font-family:\\\'Times New Roman\\\';\\\">任何计算机不得安装与工作无关的软件（如单机游戏、在线游戏等），一旦发现上班时间玩游戏、娱乐者，一律罚款</span><span lang=\\\"EN-US\\\"><span style=\\\"font-family:\\\'Times New Roman\\\';\\\">200</span></span><span style=\\\"font-family:宋体;mso-ascii-font-family:\\\'Times New Roman\\\';mso-hansi-font-family:\\\'Times New Roman\\\';\\\">元，再次发现者罚款</span><span lang=\\\"EN-US\\\"><span style=\\\"font-family:\\\'Times New Roman\\\';\\\">400</span></span><span style=\\\"font-family:宋体;mso-ascii-font-family:\\\'Times New Roman\\\';mso-hansi-font-family:\\\'Times New Roman\\\';\\\">元，以此类推。</span></span></p>\r\n<p style=\\\"margin:0cm 0cm 0pt;\\\" class=\\\"MsoNormal\\\"><span lang=\\\"EN-US\\\"><o:p><span style=\\\"font-family:\\\'Times New Roman\\\';font-size:small;\\\">&nbsp;</span></o:p></span></p>\r\n<p style=\\\"margin:0cm 0cm 0pt;\\\" class=\\\"MsoNormal\\\"><span style=\\\"font-size:small;\\\"><span style=\\\"font-family:宋体;mso-ascii-font-family:\\\'Times New Roman\\\';mso-hansi-font-family:\\\'Times New Roman\\\';\\\">第</span><span lang=\\\"EN-US\\\"><span style=\\\"font-family:\\\'Times New Roman\\\';\\\">5</span></span><span style=\\\"font-family:宋体;mso-ascii-font-family:\\\'Times New Roman\\\';mso-hansi-font-family:\\\'Times New Roman\\\';\\\">条</span><span lang=\\\"EN-US\\\"><span style=\\\"font-family:\\\'Times New Roman\\\';\\\"> </span></span></span></p>\r\n<p style=\\\"margin:0cm 0cm 0pt;\\\" class=\\\"MsoNormal\\\"><span style=\\\"font-size:small;\\\"><span lang=\\\"EN-US\\\"><span style=\\\"font-family:\\\'Times New Roman\\\';\\\">1. </span></span><span style=\\\"font-family:宋体;mso-ascii-font-family:\\\'Times New Roman\\\';mso-hansi-font-family:\\\'Times New Roman\\\';\\\">任何人不允许在网络上从事与工作无关的事项，违反者将受到处罚。一律罚款</span><span lang=\\\"EN-US\\\"><span style=\\\"font-family:\\\'Times New Roman\\\';\\\">50</span></span><span style=\\\"font-family:宋体;mso-ascii-font-family:\\\'Times New Roman\\\';mso-hansi-font-family:\\\'Times New Roman\\\';\\\">元，再次发现者罚款</span><span lang=\\\"EN-US\\\"><span style=\\\"font-family:\\\'Times New Roman\\\';\\\">100</span></span><span style=\\\"font-family:宋体;mso-ascii-font-family:\\\'Times New Roman\\\';mso-hansi-font-family:\\\'Times New Roman\\\';\\\">元，以此类推。同时也不允许任何与工作无关的信息出现在网络上，如出现要追查责任；</span></span></p>\r\n<p style=\\\"margin:0cm 0cm 0pt;\\\" class=\\\"MsoNormal\\\"><span lang=\\\"EN-US\\\"><o:p><span style=\\\"font-family:\\\'Times New Roman\\\';font-size:small;\\\">&nbsp;</span></o:p></span></p>\r\n<p style=\\\"margin:0cm 0cm 0pt;\\\" class=\\\"MsoNormal\\\"><span style=\\\"font-size:small;\\\"><span lang=\\\"EN-US\\\"><span style=\\\"font-family:\\\'Times New Roman\\\';\\\">2. </span></span><span style=\\\"font-family:宋体;mso-ascii-font-family:\\\'Times New Roman\\\';mso-hansi-font-family:\\\'Times New Roman\\\';\\\">严禁任何人以任何手段，蓄意破坏公司网络的正常运行，或窃取公司网上的保护信息；</span></span></p>\r\n<p style=\\\"margin:0cm 0cm 0pt;\\\" class=\\\"MsoNormal\\\"><span lang=\\\"EN-US\\\"><span style=\\\"mso-spacerun:yes;\\\"><span style=\\\"font-family:\\\'Times New Roman\\\';font-size:small;\\\">&nbsp; </span></span></span></p>\r\n<p style=\\\"margin:0cm 0cm 0pt;\\\" class=\\\"MsoNormal\\\"><span style=\\\"font-size:small;\\\"><span lang=\\\"EN-US\\\"><span style=\\\"font-family:\\\'Times New Roman\\\';\\\">3. </span></span><span style=\\\"font-family:宋体;mso-ascii-font-family:\\\'Times New Roman\\\';mso-hansi-font-family:\\\'Times New Roman\\\';\\\">严禁在公司网络上玩任何形式的网络游戏、浏览与工作无关的图片、等各种与工作无关的内容。违反者将受到处分；</span></span></p>\r\n<p style=\\\"margin:0cm 0cm 0pt;\\\" class=\\\"MsoNormal\\\"><span lang=\\\"EN-US\\\"><o:p><span style=\\\"font-family:\\\'Times New Roman\\\';font-size:small;\\\">&nbsp;</span></o:p></span></p>\r\n<p style=\\\"margin:0cm 0cm 0pt;\\\" class=\\\"MsoNormal\\\"><span style=\\\"font-size:small;\\\"><span lang=\\\"EN-US\\\"><span style=\\\"font-family:\\\'Times New Roman\\\';\\\">4. </span></span><span style=\\\"font-family:宋体;mso-ascii-font-family:\\\'Times New Roman\\\';mso-hansi-font-family:\\\'Times New Roman\\\';\\\">任何部门和个人应高度重视保护公司的技术秘密和商业秘密，对于需要上网的各类保密信息必须保证有严密的授权控制；</span></span></p>\r\n<p style=\\\"margin:0cm 0cm 0pt;\\\" class=\\\"MsoNormal\\\"><span lang=\\\"EN-US\\\"><span style=\\\"mso-spacerun:yes;\\\"><span style=\\\"font-family:\\\'Times New Roman\\\';font-size:small;\\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span></p>\r\n<p style=\\\"margin:0cm 0cm 0pt;\\\" class=\\\"MsoNormal\\\"><span style=\\\"font-size:small;\\\"><span lang=\\\"EN-US\\\"><span style=\\\"font-family:\\\'Times New Roman\\\';\\\">5. </span></span><span style=\\\"font-family:宋体;mso-ascii-font-family:\\\'Times New Roman\\\';mso-hansi-font-family:\\\'Times New Roman\\\';\\\">售后部客户详细资料统计由售后经理负责加密服务，保管各种客户资料，严谨泄露任何资料。</span></span></p>\r\n<p style=\\\"margin:0cm 0cm 0pt;\\\" class=\\\"MsoNormal\\\"><span lang=\\\"EN-US\\\"><span style=\\\"mso-spacerun:yes;\\\"><span style=\\\"font-family:\\\'Times New Roman\\\';font-size:small;\\\">&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span></p>\r\n<p style=\\\"margin:0cm 0cm 0pt;\\\" class=\\\"MsoNormal\\\"><span style=\\\"font-size:small;\\\"><span lang=\\\"EN-US\\\"><span style=\\\"font-family:\\\'Times New Roman\\\';\\\">6</span></span><span style=\\\"font-family:宋体;mso-ascii-font-family:\\\'Times New Roman\\\';mso-hansi-font-family:\\\'Times New Roman\\\';\\\">．财务部的各种公司详细报表由财务部负责制作加密服务，保管各项公司财务资料。严谨泄露任何资料。</span></span></p>\r\n<p style=\\\"margin:0cm 0cm 0pt;\\\" class=\\\"MsoNormal\\\"><span lang=\\\"EN-US\\\"><span style=\\\"mso-spacerun:yes;\\\"><span style=\\\"font-family:\\\'Times New Roman\\\';font-size:small;\\\">&nbsp;</span></span></span></p>\r\n<p style=\\\"margin:0cm 0cm 0pt;\\\" class=\\\"MsoNormal\\\"><span style=\\\"font-size:small;\\\"><span style=\\\"font-family:宋体;mso-ascii-font-family:\\\'Times New Roman\\\';mso-hansi-font-family:\\\'Times New Roman\\\';\\\">第</span><span lang=\\\"EN-US\\\"><span style=\\\"font-family:\\\'Times New Roman\\\';\\\">6</span></span><span style=\\\"font-family:宋体;mso-ascii-font-family:\\\'Times New Roman\\\';mso-hansi-font-family:\\\'Times New Roman\\\';\\\">条</span><span lang=\\\"EN-US\\\"><span style=\\\"mso-spacerun:yes;\\\"><span style=\\\"font-family:\\\'Times New Roman\\\';\\\">&nbsp;&nbsp; </span></span></span></span></p>\r\n<p style=\\\"margin:0cm 0cm 0pt;\\\" class=\\\"MsoNormal\\\"><span style=\\\"font-size:small;\\\"><span lang=\\\"EN-US\\\"><span style=\\\"font-family:\\\'Times New Roman\\\';\\\">1. </span></span><span style=\\\"font-family:宋体;mso-ascii-font-family:\\\'Times New Roman\\\';mso-hansi-font-family:\\\'Times New Roman\\\';\\\">对于蓄意破坏网络正常运行，蓄意窃取网上秘密信息的个人，作辞退处理，并依法追究法律责任；</span></span></p>\r\n<p style=\\\"margin:0cm 0cm 0pt;\\\" class=\\\"MsoNormal\\\"><span lang=\\\"EN-US\\\"><span style=\\\"mso-spacerun:yes;\\\"><span style=\\\"font-family:\\\'Times New Roman\\\';font-size:small;\\\">&nbsp;&nbsp; </span></span></span></p>\r\n<p style=\\\"margin:0cm 0cm 0pt;\\\" class=\\\"MsoNormal\\\"><span lang=\\\"EN-US\\\"><span style=\\\"mso-spacerun:yes;\\\"><span style=\\\"font-family:\\\'Times New Roman\\\';font-size:small;\\\">&nbsp;</span></span></span></p>\r\n<p style=\\\"margin:0cm 0cm 0pt;\\\" class=\\\"MsoNormal\\\"><span style=\\\"font-size:small;\\\"><span lang=\\\"EN-US\\\"><span style=\\\"font-family:\\\'Times New Roman\\\';\\\">2.</span></span><span style=\\\"font-family:宋体;mso-ascii-font-family:\\\'Times New Roman\\\';mso-hansi-font-family:\\\'Times New Roman\\\';\\\">对于由管理不善引起公司秘密泄露的责任人，处以罚款、降薪、降职或辞退等处理；</span></span></p>\r\n<p style=\\\"margin:0cm 0cm 0pt;\\\" class=\\\"MsoNormal\\\"><span lang=\\\"EN-US\\\"><o:p><span style=\\\"font-family:\\\'Times New Roman\\\';font-size:small;\\\">&nbsp;</span></o:p></span></p>\r\n<p style=\\\"margin:0cm 0cm 0pt;\\\" class=\\\"MsoNormal\\\"><span style=\\\"font-size:small;\\\"><span lang=\\\"EN-US\\\"><span style=\\\"font-family:\\\'Times New Roman\\\';\\\">3.</span></span><span style=\\\"font-family:宋体;mso-ascii-font-family:\\\'Times New Roman\\\';mso-hansi-font-family:\\\'Times New Roman\\\';\\\">任何员工发送与工作无关的电子邮件，有意接收与工作无关的邮件，一律罚款</span><span lang=\\\"EN-US\\\"><span style=\\\"font-family:\\\'Times New Roman\\\';\\\">100</span></span><span style=\\\"font-family:宋体;mso-ascii-font-family:\\\'Times New Roman\\\';mso-hansi-font-family:\\\'Times New Roman\\\';\\\">元，再次发现者罚款</span><span lang=\\\"EN-US\\\"><span style=\\\"font-family:\\\'Times New Roman\\\';\\\">200</span></span><span style=\\\"font-family:宋体;mso-ascii-font-family:\\\'Times New Roman\\\';mso-hansi-font-family:\\\'Times New Roman\\\';\\\">元，以此类推。</span></span></p>\r\n<p style=\\\"margin:0cm 0cm 0pt;\\\" class=\\\"MsoNormal\\\"><span lang=\\\"EN-US\\\"><o:p><span style=\\\"font-family:\\\'Times New Roman\\\';font-size:small;\\\">&nbsp;</span></o:p></span></p>\r\n<p style=\\\"margin:0cm 0cm 0pt;\\\" class=\\\"MsoNormal\\\"><span style=\\\"font-size:small;\\\"><span lang=\\\"EN-US\\\"><span style=\\\"font-family:\\\'Times New Roman\\\';\\\">4.</span></span><span style=\\\"font-family:宋体;mso-ascii-font-family:\\\'Times New Roman\\\';mso-hansi-font-family:\\\'Times New Roman\\\';\\\">对于其他任何利用网络资源从事与工作无关的行为，一律罚款</span><span lang=\\\"EN-US\\\"><span style=\\\"font-family:\\\'Times New Roman\\\';\\\">100</span></span><span style=\\\"font-family:宋体;mso-ascii-font-family:\\\'Times New Roman\\\';mso-hansi-font-family:\\\'Times New Roman\\\';\\\">元，再次发现者罚款</span><span lang=\\\"EN-US\\\"><span style=\\\"font-family:\\\'Times New Roman\\\';\\\">200</span></span><span style=\\\"font-family:宋体;mso-ascii-font-family:\\\'Times New Roman\\\';mso-hansi-font-family:\\\'Times New Roman\\\';\\\">元，以此类推。</span></span></p>\r\n<p style=\\\"margin:0cm 0cm 0pt;\\\" class=\\\"MsoNormal\\\"><span lang=\\\"EN-US\\\"><o:p><span style=\\\"font-family:\\\'Times New Roman\\\';font-size:small;\\\">&nbsp;</span></o:p></span></p>\r\n<p style=\\\"margin:0cm 0cm 0pt;\\\" class=\\\"MsoNormal\\\"><span lang=\\\"EN-US\\\"><o:p><span style=\\\"font-family:\\\'Times New Roman\\\';font-size:small;\\\">&nbsp;</span></o:p></span></p>\r\n<p style=\\\"margin:0cm 0cm 0pt;\\\" class=\\\"MsoNormal\\\"><span lang=\\\"EN-US\\\"><o:p><span style=\\\"font-family:\\\'Times New Roman\\\';font-size:small;\\\">&nbsp;</span></o:p></span></p>\r\n<p style=\\\"margin:0cm 0cm 0pt;\\\" class=\\\"MsoNormal\\\"><b style=\\\"mso-bidi-font-weight:normal;\\\"><span style=\\\"font-family:宋体;font-size:14pt;mso-ascii-font-family:\\\'Times New Roman\\\';mso-hansi-font-family:\\\'Times New Roman\\\';\\\">使用注意事项</span></b><b style=\\\"mso-bidi-font-weight:normal;\\\"><span style=\\\"font-size:14pt;\\\" lang=\\\"EN-US\\\"><span style=\\\"font-family:\\\'Times New Roman\\\';\\\"> <o:p></o:p></span></span></b></p>\r\n<p style=\\\"text-indent:-21.75pt;margin:0cm 0cm 0pt 21.75pt;mso-list:l0 level1 lfo1;tab-stops:list 21.75pt;\\\" class=\\\"MsoNormal\\\"><span style=\\\"mso-fareast-font-family:\\\'Times New Roman\\\';\\\" lang=\\\"EN-US\\\"><span style=\\\"mso-list:Ignore;\\\"><span style=\\\"font-family:\\\'Times New Roman\\\';\\\"><span style=\\\"font-size:small;\\\">1．</span><span style=\\\"font:7pt \\\'Times New Roman\\\';\\\">&nbsp;&nbsp;&nbsp; </span></span></span></span><span style=\\\"font-size:small;\\\"><span style=\\\"font-family:宋体;mso-ascii-font-family:\\\'Times New Roman\\\';mso-hansi-font-family:\\\'Times New Roman\\\';\\\">使用者应保持电脑设备及办公桌环境的清洁。机器脏乱差不干净者，一次罚款</span><span lang=\\\"EN-US\\\"><span style=\\\"font-family:\\\'Times New Roman\\\';\\\">50</span></span><span style=\\\"font-family:宋体;mso-ascii-font-family:\\\'Times New Roman\\\';mso-hansi-font-family:\\\'Times New Roman\\\';\\\">元。</span></span></p>\r\n<p style=\\\"margin:0cm 0cm 0pt;\\\" class=\\\"MsoNormal\\\"><span lang=\\\"EN-US\\\"><o:p><span style=\\\"font-family:\\\'Times New Roman\\\';font-size:small;\\\">&nbsp;</span></o:p></span></p>\r\n<p style=\\\"margin:0cm 0cm 0pt;\\\" class=\\\"MsoNormal\\\"><span style=\\\"font-size:small;\\\"><span lang=\\\"EN-US\\\"><span style=\\\"font-family:\\\'Times New Roman\\\';\\\">2.<span style=\\\"mso-spacerun:yes;\\\">&nbsp; </span></span></span><span style=\\\"font-family:宋体;mso-ascii-font-family:\\\'Times New Roman\\\';mso-hansi-font-family:\\\'Times New Roman\\\';\\\">下班时，务必正确关机切断电源，中午午休外出吃饭或下班没有按时关机或没关显示器者发现一次罚款</span><span lang=\\\"EN-US\\\"><span style=\\\"font-family:\\\'Times New Roman\\\';\\\">50</span></span><span style=\\\"font-family:宋体;mso-ascii-font-family:\\\'Times New Roman\\\';mso-hansi-font-family:\\\'Times New Roman\\\';\\\">元，再次发现罚款</span><span lang=\\\"EN-US\\\"><span style=\\\"font-family:\\\'Times New Roman\\\';\\\">100</span></span><span style=\\\"font-family:宋体;mso-ascii-font-family:\\\'Times New Roman\\\';mso-hansi-font-family:\\\'Times New Roman\\\';\\\">元，以此类推。</span></span></p>\r\n<p style=\\\"margin:0cm 0cm 0pt;\\\" class=\\\"MsoNormal\\\"><span lang=\\\"EN-US\\\"><o:p><span style=\\\"font-family:\\\'Times New Roman\\\';font-size:small;\\\">&nbsp;</span></o:p></span></p>\r\n<p style=\\\"margin:0cm 0cm 0pt;\\\" class=\\\"MsoNormal\\\"><span style=\\\"font-size:small;\\\"><span lang=\\\"EN-US\\\"><span style=\\\"font-family:\\\'Times New Roman\\\';\\\">3</span></span><span style=\\\"font-family:宋体;mso-ascii-font-family:\\\'Times New Roman\\\';mso-hansi-font-family:\\\'Times New Roman\\\';\\\">．</span><span style=\\\"font-family:\\\'Times New Roman\\\';\\\"> </span><span style=\\\"font-family:宋体;mso-ascii-font-family:\\\'Times New Roman\\\';mso-hansi-font-family:\\\'Times New Roman\\\';\\\">使用者应定期对电脑内的资料进行整理，定期清理系统内的垃圾文件。</span><span lang=\\\"EN-US\\\"><span style=\\\"font-family:\\\'Times New Roman\\\';\\\"> </span></span></span></p>\r\n<p style=\\\"margin:0cm 0cm 0pt;\\\" class=\\\"MsoNormal\\\"><span lang=\\\"EN-US\\\"><span style=\\\"mso-spacerun:yes;\\\"><span style=\\\"font-family:\\\'Times New Roman\\\';font-size:small;\\\">&nbsp;&nbsp; </span></span></span></p>\r\n<p style=\\\"margin:0cm 0cm 0pt;\\\" class=\\\"MsoNormal\\\"><span style=\\\"font-size:small;\\\"><span lang=\\\"EN-US\\\"><span style=\\\"font-family:\\\'Times New Roman\\\';\\\">4</span></span><span style=\\\"font-family:宋体;mso-ascii-font-family:\\\'Times New Roman\\\';mso-hansi-font-family:\\\'Times New Roman\\\';\\\">．</span><span style=\\\"font-family:\\\'Times New Roman\\\';\\\"> </span><span style=\\\"font-family:宋体;mso-ascii-font-family:\\\'Times New Roman\\\';mso-hansi-font-family:\\\'Times New Roman\\\';\\\">公司内的重要数据，应每周备份一次。</span><span lang=\\\"EN-US\\\"><span style=\\\"font-family:\\\'Times New Roman\\\';\\\"> </span></span></span></p>\r\n<p style=\\\"margin:0cm 0cm 0pt;\\\" class=\\\"MsoNormal\\\"><span lang=\\\"EN-US\\\"><o:p><span style=\\\"font-family:\\\'Times New Roman\\\';font-size:small;\\\">&nbsp;</span></o:p></span></p>\r\n<p style=\\\"margin:0cm 0cm 0pt;\\\" class=\\\"MsoNormal\\\"><span style=\\\"font-size:small;\\\"><span lang=\\\"EN-US\\\"><span style=\\\"font-family:\\\'Times New Roman\\\';\\\">5</span></span><span style=\\\"font-family:宋体;mso-ascii-font-family:\\\'Times New Roman\\\';mso-hansi-font-family:\\\'Times New Roman\\\';\\\">．</span><span style=\\\"font-family:\\\'Times New Roman\\\';\\\"> </span><span style=\\\"font-family:宋体;mso-ascii-font-family:\\\'Times New Roman\\\';mso-hansi-font-family:\\\'Times New Roman\\\';\\\">不要随意打开来历不明的网站和文件。</span><span lang=\\\"EN-US\\\"><span style=\\\"font-family:\\\'Times New Roman\\\';\\\"> </span></span></span></p>\r\n<p style=\\\"margin:0cm 0cm 0pt;\\\" class=\\\"MsoNormal\\\"><span lang=\\\"EN-US\\\"><o:p><span style=\\\"font-family:\\\'Times New Roman\\\';font-size:small;\\\">&nbsp;</span></o:p></span></p>\r\n<p style=\\\"margin:0cm 0cm 0pt;\\\" class=\\\"MsoNormal\\\"><span style=\\\"font-size:small;\\\"><span lang=\\\"EN-US\\\"><span style=\\\"font-family:\\\'Times New Roman\\\';\\\">6</span></span><span style=\\\"font-family:宋体;mso-ascii-font-family:\\\'Times New Roman\\\';mso-hansi-font-family:\\\'Times New Roman\\\';\\\">．</span><span style=\\\"font-family:\\\'Times New Roman\\\';\\\"> </span><span style=\\\"font-family:宋体;mso-ascii-font-family:\\\'Times New Roman\\\';mso-hansi-font-family:\\\'Times New Roman\\\';\\\">如需要下载软件，建议到正规的网站下载。</span><span lang=\\\"EN-US\\\"><span style=\\\"font-family:\\\'Times New Roman\\\';\\\"> </span></span></span></p>\r\n<p style=\\\"margin:0cm 0cm 0pt;\\\" class=\\\"MsoNormal\\\"><span lang=\\\"EN-US\\\"><o:p><span style=\\\"font-family:\\\'Times New Roman\\\';font-size:small;\\\">&nbsp;</span></o:p></span></p>\r\n<p style=\\\"margin:0cm 0cm 0pt;\\\" class=\\\"MsoNormal\\\"><span style=\\\"font-size:small;\\\"><span lang=\\\"EN-US\\\"><span style=\\\"font-family:\\\'Times New Roman\\\';\\\">7</span></span><span style=\\\"font-family:宋体;mso-ascii-font-family:\\\'Times New Roman\\\';mso-hansi-font-family:\\\'Times New Roman\\\';\\\">．</span><span style=\\\"font-family:\\\'Times New Roman\\\';\\\"> </span><span style=\\\"font-family:宋体;mso-ascii-font-family:\\\'Times New Roman\\\';mso-hansi-font-family:\\\'Times New Roman\\\';\\\">公司内部数据资料列入保密范围之内，严禁外泄。</span><span lang=\\\"EN-US\\\"><span style=\\\"font-family:\\\'Times New Roman\\\';\\\"> </span></span></span></p>\r\n<p style=\\\"margin:0cm 0cm 0pt;\\\" class=\\\"MsoNormal\\\"><span lang=\\\"EN-US\\\"><o:p><span style=\\\"font-family:\\\'Times New Roman\\\';font-size:small;\\\">&nbsp;</span></o:p></span></p>\r\n<p style=\\\"margin:0cm 0cm 0pt;\\\" class=\\\"MsoNormal\\\"><span style=\\\"font-size:small;\\\"><span lang=\\\"EN-US\\\"><span style=\\\"font-family:\\\'Times New Roman\\\';\\\">8</span></span><span style=\\\"font-family:宋体;mso-ascii-font-family:\\\'Times New Roman\\\';mso-hansi-font-family:\\\'Times New Roman\\\';\\\">．</span><span style=\\\"font-family:\\\'Times New Roman\\\';\\\"> </span><span style=\\\"font-family:宋体;mso-ascii-font-family:\\\'Times New Roman\\\';mso-hansi-font-family:\\\'Times New Roman\\\';\\\">使用者必须妥善保管好自己的用户名和密码，严防被窃取。</span><span lang=\\\"EN-US\\\"><span style=\\\"font-family:\\\'Times New Roman\\\';\\\"> </span></span></span></p>\r\n<p style=\\\"margin:0cm 0cm 0pt;\\\" class=\\\"MsoNormal\\\"><span lang=\\\"EN-US\\\"><o:p><span style=\\\"font-family:\\\'Times New Roman\\\';font-size:small;\\\">&nbsp;</span></o:p></span></p>\r\n<p style=\\\"margin:0cm 0cm 0pt;\\\" class=\\\"MsoNormal\\\"><span style=\\\"font-size:small;\\\"><span lang=\\\"EN-US\\\"><span style=\\\"font-family:\\\'Times New Roman\\\';\\\">9</span></span><span style=\\\"font-family:宋体;mso-ascii-font-family:\\\'Times New Roman\\\';mso-hansi-font-family:\\\'Times New Roman\\\';\\\">．</span><span style=\\\"font-family:\\\'Times New Roman\\\';\\\"> </span><span style=\\\"font-family:宋体;mso-ascii-font-family:\\\'Times New Roman\\\';mso-hansi-font-family:\\\'Times New Roman\\\';\\\">重要数据资料不要存放在</span><span lang=\\\"EN-US\\\"><span style=\\\"font-family:\\\'Times New Roman\\\';\\\">C</span></span><span style=\\\"font-family:宋体;mso-ascii-font-family:\\\'Times New Roman\\\';mso-hansi-font-family:\\\'Times New Roman\\\';\\\">盘或桌面，以免系统崩溃时丢失。</span><span lang=\\\"EN-US\\\"><span style=\\\"font-family:\\\'Times New Roman\\\';\\\"> </span></span></span></p>\r\n<p style=\\\"margin:0cm 0cm 0pt;\\\" class=\\\"MsoNormal\\\"><span lang=\\\"EN-US\\\"><o:p><span style=\\\"font-family:\\\'Times New Roman\\\';font-size:small;\\\">&nbsp;</span></o:p></span></p>\r\n<p style=\\\"margin:0cm 0cm 0pt;\\\" class=\\\"MsoNormal\\\"><span style=\\\"font-size:small;\\\"><span lang=\\\"EN-US\\\"><span style=\\\"font-family:\\\'Times New Roman\\\';\\\">10</span></span><span style=\\\"font-family:宋体;mso-ascii-font-family:\\\'Times New Roman\\\';mso-hansi-font-family:\\\'Times New Roman\\\';\\\">．使用者应定期自行升级其电脑杀毒软件，并每周进行病毒扫描。</span></span></p>\r\n<p style=\\\"margin:0cm 0cm 0pt;\\\" class=\\\"MsoNormal\\\"><span lang=\\\"EN-US\\\"><o:p><span style=\\\"font-family:\\\'Times New Roman\\\';font-size:small;\\\">&nbsp;</span></o:p></span></p>\r\n<p style=\\\"text-indent:-15.75pt;margin:0cm 0cm 0pt 15.75pt;mso-char-indent-count:-1.5;\\\" class=\\\"MsoNormal\\\"><span style=\\\"font-size:small;\\\"><span lang=\\\"EN-US\\\"><span style=\\\"font-family:\\\'Times New Roman\\\';\\\">11. </span></span><span style=\\\"font-family:宋体;mso-ascii-font-family:\\\'Times New Roman\\\';mso-hansi-font-family:\\\'Times New Roman\\\';\\\">公司</span><span lang=\\\"EN-US\\\"><span style=\\\"font-family:\\\'Times New Roman\\\';\\\">OA</span></span><span style=\\\"font-family:宋体;mso-ascii-font-family:\\\'Times New Roman\\\';mso-hansi-font-family:\\\'Times New Roman\\\';\\\">账号密码每三个月更新一次，个人</span><span lang=\\\"EN-US\\\"><span style=\\\"font-family:\\\'Times New Roman\\\';\\\">OA</span></span><span style=\\\"font-family:宋体;mso-ascii-font-family:\\\'Times New Roman\\\';mso-hansi-font-family:\\\'Times New Roman\\\';\\\">账号密码统一由各部门经理保留备份，严禁告知任何与公司无关人员，严重者，公司予以辞退工作处理。</span></span></p>\r\n<p style=\\\"text-indent:-15.75pt;margin:0cm 0cm 0pt 15.75pt;mso-char-indent-count:-1.5;\\\" class=\\\"MsoNormal\\\"><span lang=\\\"EN-US\\\"><o:p><span style=\\\"font-family:\\\'Times New Roman\\\';font-size:small;\\\">&nbsp;</span></o:p></span></p>\r\n<p style=\\\"margin:0cm 0cm 0pt;\\\" class=\\\"MsoNormal\\\"><span lang=\\\"EN-US\\\"><o:p><span style=\\\"font-family:\\\'Times New Roman\\\';font-size:small;\\\">&nbsp;</span></o:p></span></p>\r\n<p st