INSERT INTO `articles` VALUES ('7', '仪容仪表规定', '3', '<div class=\\\"Section0\\\" style=\\\"layout-grid:15.6pt none;\\\"><span style=\\\"font-weight:bold;font-size:16pt;color:#000000;font-family:\\\'宋体\\\';mso-spacerun:\\\'yes\\\';\\\"> <div>\r\n<div class=\\\"Section0\\\" style=\\\"layout-grid:15.6pt none;\\\"><span style=\\\"font-size:10.5pt;font-family:\\\'宋体\\\';mso-spacerun:\\\'yes\\\';\\\"><?xml:namespace prefix = o ns = \\\"urn:schemas-microsoft-com:office:office\\\" /><o:p> <div class=\\\"Section0\\\" style=\\\"layout-grid:15.6pt none;\\\">\r\n<p class=\\\"p0\\\" style=\\\"margin-top:0pt;margin-bottom:0pt;text-align:center;\\\"><span style=\\\"font-size:9pt;font-family:\\\'宋体\\\';mso-spacerun:\\\'yes\\\';\\\">&nbsp;</span><span style=\\\"font-weight:bold;font-size:16pt;color:#000000;font-family:\\\'宋体\\\';mso-spacerun:\\\'yes\\\';\\\">仪容仪表规定</span><span style=\\\"font-size:16pt;font-family:\\\'宋体\\\';mso-spacerun:\\\'yes\\\';\\\"><o:p></o:p></span></p>\r\n<p class=\\\"p0\\\" style=\\\"margin-top:0pt;margin-bottom:0pt;margin-left:4.44pt;text-indent:-4.44pt;line-height:22pt;text-align:left;\\\"><span style=\\\"font-size:12pt;color:#000000;font-family:\\\'宋体\\\';mso-spacerun:\\\'yes\\\';\\\">一、仪容仪表</span><span style=\\\"font-size:12pt;font-family:\\\'宋体\\\';mso-spacerun:\\\'yes\\\';\\\">要求</span><span style=\\\"font-size:12pt;color:#000000;font-family:\\\'宋体\\\';mso-spacerun:\\\'yes\\\';\\\">：整洁</span><span style=\\\"font-size:12pt;color:#000000;font-family:\\\'宋体\\\';mso-spacerun:\\\'yes\\\';\\\">，</span><span style=\\\"font-size:12pt;color:#000000;font-family:\\\'宋体\\\';mso-spacerun:\\\'yes\\\';\\\">大方</span><span style=\\\"font-size:12pt;color:#000000;font-family:\\\'宋体\\\';mso-spacerun:\\\'yes\\\';\\\">，</span><span style=\\\"font-size:12pt;color:#000000;font-family:\\\'宋体\\\';mso-spacerun:\\\'yes\\\';\\\">得体，精神饱满。</span><span style=\\\"font-size:9pt;font-family:\\\'宋体\\\';mso-spacerun:\\\'yes\\\';\\\"><o:p></o:p></span></p>\r\n<p class=\\\"p0\\\" style=\\\"margin-top:0pt;margin-bottom:0pt;margin-left:-0.05pt;text-indent:0.05pt;line-height:22pt;text-align:left;\\\"><span style=\\\"font-size:12pt;color:#000000;font-family:\\\'宋体\\\';mso-spacerun:\\\'yes\\\';\\\">二、男士着装要求：</span><span style=\\\"font-size:9pt;font-family:\\\'宋体\\\';mso-spacerun:\\\'yes\\\';\\\"><o:p></o:p></span></p>\r\n<p class=\\\"p0\\\" style=\\\"margin-top:0pt;margin-bottom:0pt;margin-left:24.045pt;line-height:22pt;text-align:left;\\\"><span style=\\\"font-size:12pt;color:#000000;font-family:\\\'宋体\\\';mso-spacerun:\\\'yes\\\';\\\">穿着浅色短袖衬衫</span><span style=\\\"font-size:12pt;color:#000000;font-family:\\\'宋体\\\';mso-spacerun:\\\'yes\\\';\\\">或有领有袖上衣</span><span style=\\\"font-size:12pt;color:#000000;font-family:\\\'宋体\\\';mso-spacerun:\\\'yes\\\';\\\">（单色或小花纹）</span><span style=\\\"font-size:12pt;color:#000000;font-family:\\\'宋体\\\';mso-spacerun:\\\'yes\\\';\\\">，上班时间不得穿无领T恤及文化衫，牛仔裤，短裤，拖鞋等。</span><span style=\\\"font-size:9pt;font-family:\\\'宋体\\\';mso-spacerun:\\\'yes\\\';\\\"><o:p></o:p></span></p>\r\n<p class=\\\"p0\\\" style=\\\"margin-top:0pt;margin-bottom:0pt;margin-left:4.5pt;line-height:22pt;text-align:left;\\\"><span style=\\\"font-size:12pt;color:#000000;font-family:\\\'宋体\\\';mso-spacerun:\\\'yes\\\';\\\">三、女士着装要求：</span><span style=\\\"font-size:12pt;color:#000000;font-family:\\\'宋体\\\';mso-spacerun:\\\'yes\\\';\\\"><o:p></o:p></span></p>\r\n<p class=\\\"p0\\\" style=\\\"margin-top:0pt;margin-bottom:0pt;margin-left:22.47pt;line-height:22pt;text-align:left;\\\"><span style=\\\"font-size:12pt;color:#000000;font-family:\\\'宋体\\\';mso-spacerun:\\\'yes\\\';\\\">女士着装要大方得体，上班时间不得穿过于休闲、暴露的服装，（如过于休闲的无领T恤及文化衫）不得穿拖鞋，短裤，背心等</span><span style=\\\"font-size:12pt;color:#000000;font-family:\\\'宋体\\\';mso-spacerun:\\\'yes\\\';\\\">。</span><span style=\\\"font-size:12pt;color:#000000;font-family:\\\'宋体\\\';mso-spacerun:\\\'yes\\\';\\\">&nbsp;</span><span style=\\\"font-size:12pt;color:#000000;font-family:\\\'宋体\\\';mso-spacerun:\\\'yes\\\';\\\"><o:p></o:p></span></p>\r\n<p class=\\\"p0\\\" style=\\\"margin-top:0pt;margin-bottom:0pt;margin-left:22.44pt;text-indent:-22.44pt;line-height:22pt;text-align:left;\\\"><span style=\\\"font-size:12pt;color:#000000;font-family:\\\'宋体\\\';mso-spacerun:\\\'yes\\\';\\\">四、</span><span style=\\\"font-size:12pt;color:#000000;font-family:\\\'宋体\\\';mso-spacerun:\\\'yes\\\';\\\">代表公司面见客户（含公司内面见和外出面见）均代表公司形象，一律穿着&nbsp;&nbsp;职业装并佩戴工牌。</span><span style=\\\"font-size:12pt;color:#000000;font-family:\\\'宋体\\\';mso-spacerun:\\\'yes\\\';\\\"><o:p></o:p></span></p>\r\n<p class=\\\"p0\\\" style=\\\"margin-top:0pt;margin-bottom:0pt;line-height:22pt;text-align:left;\\\"><span style=\\\"font-size:12pt;color:#000000;font-family:\\\'宋体\\\';mso-spacerun:\\\'yes\\\';\\\">五、</span><span style=\\\"font-size:12pt;color:#000000;font-family:\\\'宋体\\\';mso-spacerun:\\\'yes\\\';\\\">上班时间均佩戴工牌。</span><span style=\\\"font-size:12pt;color:#000000;font-family:\\\'宋体\\\';mso-spacerun:\\\'yes\\\';\\\"><o:p></o:p></span></p>\r\n<p class=\\\"p0\\\" style=\\\"margin-top:0pt;margin-bottom:0pt;margin-left:-0.05pt;text-indent:0.05pt;line-height:22pt;text-align:left;\\\"><span style=\\\"font-size:12pt;color:#000000;font-family:\\\'宋体\\\';mso-spacerun:\\\'yes\\\';\\\">六</span><span style=\\\"font-size:12pt;color:#000000;font-family:\\\'宋体\\\';mso-spacerun:\\\'yes\\\';\\\">、</span><span style=\\\"font-size:9pt;font-family:\\\'宋体\\\';mso-spacerun:\\\'yes\\\';\\\">&nbsp;</span><span style=\\\"font-size:12pt;color:#000000;font-family:\\\'宋体\\\';mso-spacerun:\\\'yes\\\';\\\">本规定由</span><span style=\\\"font-size:12pt;font-family:\\\'宋体\\\';mso-spacerun:\\\'yes\\\';\\\">人资</span><span style=\\\"font-size:12pt;font-family:\\\'宋体\\\';mso-spacerun:\\\'yes\\\';\\\">部</span><span style=\\\"font-size:12pt;color:#000000;font-family:\\\'宋体\\\';mso-spacerun:\\\'yes\\\';\\\">负责解释。</span><span style=\\\"font-size:9pt;font-family:\\\'宋体\\\';mso-spacerun:\\\'yes\\\';\\\"><o:p></o:p></span></p>\r\n<p class=\\\"p0\\\" style=\\\"margin-top:0pt;m