INSERT INTO `communication` VALUES ('6', '23', '12', '客户要做个企业站。预算几百。推荐标准建站，先发资料给客户。', '2011-05-18 09:19:42', '2011-05-18 09:19:42');
INSERT INTO `communication` VALUES ('7', '27', '17', '这个是刚刚注册的一个小公司 执照等估计要一个月之后才能下来，主要是销售空调暖通设备 仪器仪表的 。网站里面包括首页 公司简介  产品展示  联系我们 就可以。推荐5000元3年的标准建站。等QQ上线后把资料给他发过去让他看看。', '2011-05-18 09:55:04', '2011-05-18 09:55:04');
INSERT INTO `communication` VALUES ('8', '23', '20', '正在沟通。', '2011-05-18 10:16:46', '2011-05-18 10:16:46');
INSERT INTO `communication` VALUES ('9', '27', '18', '这个公司的意向挺大，通过沟通对我们公司也挺满意的，已经留下我的联系方式。而且我也把我们的案例还有标准建站的资料给她了，以后经常联系。', '2011-05-18 10:32:12', '2011-05-18 10:32:12');
INSERT INTO `communication` VALUES ('10', '27', '18', '这个公司的意向挺大，通过沟通对我们公司也挺满意的，已经留下我的联系方式。而且我也把我们的案例还有标准建站的资料给她了，以后经常联系。', '2011-05-18 10:32:12', '2011-05-18 10:32:12');
INSERT INTO `communication` VALUES ('11', '26', '21', '是个中小型私人企业，想制作一个企业网站  以推广公司产品  提高公司知名度为目的。<br />\n老板的意思是弄个模板的，推荐标准建站3888.给老板说一下，有兴趣会直接给我们联系。', '2011-05-18 10:49:46', '2011-05-18 10:49:46');
INSERT INTO `communication` VALUES ('12', '23', '20', '想要去面谈，称美工已经做好，只让我们做程序，需要空间和域名。现得需要跟领导汇报还未报价。需求还没了解清楚。', '2011-05-18 10:58:00', '2011-05-18 10:58:00');
INSERT INTO `communication` VALUES ('13', '26', '19', '要做一个展示公司形象的企业站，主要功能模块有：关于我们，新闻中心，产品中心，服务中心（意见反馈 联系我们），人才中心。色调以淡绿色，淡蓝色为主，或者是淡黄色。风格要展现朝气蓬勃，积极向上。双语，有flsh引导页。发了万网的几个尊贵版案例。', '2011-05-18 11:02:54', '2011-05-18 11:02:54');
INSERT INTO `communication` VALUES ('14', '26', '16', '做食用菌生意的，有蘑菇，木耳等。要做一个让客户知道他们产品，并去店里购买的这么一个效果。后期可能还要做关键词优化把相关资料发过去了（标准建站和优化价格）。家里人要商量一下，再给我们联系。', '2011-05-18 11:08:41', '2011-05-18 11:08:41');
INSERT INTO `communication` VALUES ('15', '26', '15', '要建一个企业站，展示公司形象，让客户知道他们的主营业务，已达到购买或合作的目的。南方人，沟通不是很清楚。', '2011-05-18 11:11:08', '2011-05-18 11:11:08');
INSERT INTO `communication` VALUES ('16', '27', '23', '这个公司是98年成立的，是一个代理教育软件也有自己的教育软件，同时也销售学校的各方面器材的东西有黑白 多媒体等。', '2011-05-18 12:07:33', '2011-05-18 12:07:33');
INSERT INTO `communication` VALUES ('17', '27', '18', '主要就是示例网站上面的一些功能模块现在还不确定，已经让她和他们领导沟通了。然后再和我联系。', '2011-05-18 15:11:21', '2011-05-18 15:11:21');
INSERT INTO `communication` VALUES ('18', '27', '23', '通过QQ又联系我了，通过沟通了解到他侧重于标准建站的标准服务，但是已经告诉他这个是没有会员系统和在线QQ的。领导现在在外地需要回来之后给领导反映一下再和我联系。', '2011-05-18 15:14:23', '2011-05-18 15:14:23');
INSERT INTO `communication` VALUES ('19', '24', '25', '电话一直无人接听', '2011-05-18 15:16:08', '2011-05-18 15:16:08');
INSERT INTO `communication` VALUES ('20', '24', '26', '想花一千元钱做一个眼睛商城，后期联系', '2011-05-18 15:17:18', '2011-05-18 15:17:18');
INSERT INTO `communication` VALUES ('21', '24', '29', '想做一个企业宣传的网站，慢慢跟进，主要是展示企业形象为主', '2011-05-18 16:01:43', '2011-05-18 16:01:43');
INSERT INTO `communication` VALUES ('22', '23', '22', '要做个博客系统，供内部的学生自行使用的。', '2011-05-18 16:27:55', '2011-05-18 16:27:55');
INSERT INTO `communication` VALUES ('23', '23', '28', '要把商城做改版。报价一万五起。需要汇报给领导后再给回复。', '2011-05-18 17:06:24', '2011-05-18 17:06:24');
INSERT INTO `communication` VALUES ('24', '4', '31', '客户是做小食品的，想做个网站，不需要在线订购，只是需要有一个展示的平台就可以，现在加他qq发几个事例网站', '2011-05-19 08:53:36', '2011-05-19 08:53:36');
INSERT INTO `communication` VALUES ('25', '24', '32', '过去面谈', '2011-05-19 09:12:10', '2011-05-19 09:12:10');
INSERT INTO `communication` VALUES ('26', '26', '30', '客户要做一个中英双语企业站，主要经营蔬菜种苗，要做出口。标准建站和传统建站都介绍了，客考虑一下做哪个，再给我联系。想架构在国外的服务器上，怕国外用户打开慢。', '2011-05-19 09:39:12', '2011-05-19 09:39:12');
INSERT INTO `communication` VALUES ('27', '26', '30', '客户要做一个中英双语企业站，主要经营蔬菜种苗，要做出口。标准建站和传统建站都介绍了，客考虑一下做哪个，再给我联系。想架构在国外的服务器上，怕国外用户打开慢。', '2011-05-19 09:39:13', '2011-05-19 09:39:13');
INSERT INTO `communication` VALUES ('28', '23', '12', '用户预算几百。推荐标准建站也嫌价格太高。', '2011-05-19 09:46:02', '2011-05-19 09:46:02');
INSERT INTO `communication` VALUES ('29', '23', '12', '用户预算几百。推荐标准建站也嫌价格太高。', '2011-05-19 09:46:03', '2011-05-19 09:46:03');
INSERT INTO `communication` VALUES ('30', '23', '33', '要改版，做中英文网站，版面风格都一样。问报价，先把需求发给客户再给报价。', '2011-05-19 09:56:39', '2011-05-19 09:56:39');
INSERT INTO `communication` VALUES ('31', '4', '35', '客户是上海的，做安防设备的，想在济南做一个门户网站，报价在十万以上，价格可以接受，现在需要做的是发短信给他我们公司地址，他找时间过来', '2011-05-19 10:42:06', '2011-05-19 10:42:06');
INSERT INTO `communication` VALUES ('32', '24', '34', '想做一个企业宣传网站，展示企业形象为主报价5000-6000', '2011-05-19 10:42:27', '2011-05-19 10:42:27');
INSERT INTO `communication` VALUES ('33', '26', '24', '考研培训机构，是一个要求比较繁琐的网站。有视频有商城模块。18号下午过来面谈过，谈了近三个小时。看了很多同行网站，谈了怎样查看网站的浏览量和alexa排名。客户回去整理一下资料后再报具体价格。客户要求8月份之前能上线。', '2011-05-19 10:49:03', '2011-05-19 10:49:03');
INSERT INTO `communication` VALUES ('34', '4', '31', '客户现在在外面呢，他做的小食品在超市里面有销售，有瓜子，蚕豆，矿泉水之类的，产品挺多的，我建议他这个网站采用万网的标准建站，下午在把万网的一些案例之类个给他发过去，在沟通，到实现位置一直没有谈论价格', '2011-05-19 11:30:15', '2011-05-19 11:30:15');
INSERT INTO `communication` VALUES ('35', '25', '37', '1：做企业宣传站,另外要带类似于OA的内部办公系统.<br />\n2：公司自己有服务器.公司行业服务于石油化工类的工程监理.', '2011-05-19 14:00:33', '2011-05-19 14:00:33');
INSERT INTO `communication` VALUES ('36', '25', '37', '1：做企业宣传站,另外要带类似于OA的内部办公系统.<br />\n2：公司自己有服务器.公司行业服务于石油化工类的工程监理.', '2011-05-19 14:00:33', '2011-05-19 14:00:33');
INSERT INTO `communication` VALUES ('37', '24', '39', '想做一个英文版的企业网站，化工行业，在确定一下功能', '2011-05-19 14:12:17', '2011-05-19 14:12:17');
INSERT INTO `communication` VALUES ('38', '26', '40', '家装设计工程公司，产品案例都要以flsh形式展示，美工要求比较高。有自己的网站，想改版，改成示例网站那样。', '2011-05-19 14:19:05', '2011-05-19 14:19:05');
INSERT INTO `communication` VALUES ('39', '23', '42', '沟通要新建个网站。预算几百。要做网站也要做优化。报价后价格差距太大。自己挂电话了。', '2011-05-19 14:27:38', '2011-05-19 14:27:38');
INSERT INTO `communication` VALUES ('40', '27', '38', '自己要做一个网站 另外还帮深圳玫瑰之约美容院咨询网站建设的事情。找了几个示例网站 等联系上之后把网址发给他', '2011-05-19 14:34:56', '2011-05-19 14:34:56');
INSERT INTO `communication` VALUES ('41', '27', '36', '蓝色作为主色调，想要做中日英三语的，这个公司主要是生产和销售都有。告诉他三语的至少一万五以上。具体的功能需求进一步沟通。', '2011-05-19 14:58:08', '2011-05-19 14:58:08');
INSERT INTO `communication` VALUES ('42', '4', '31', '推荐的万网的标准建站，他在考虑做标准的还是高级的，并且还要请示领导看做那一款网站，', '2011-05-19 15:24:40', '2011-05-19 15:24:40');
INSERT INTO `communication` VALUES ('43', '24', '43', '想做一个宣传企业形象的网站，大气美观，', '2011-05-20 09:56:27', '2011-05-20 09:56:27');
INSERT INTO `communication` VALUES ('44', '27', '44', '是一个做打印机的公司，主要是做一下产品展示，以及宣传网站。告诉报价四五千左右，看来意向挺大，说和自己合作开公司的几个朋友商量一下，到时候再联系我。', '2011-05-20 10:36:10', '2011-05-20 10:36:10');
INSERT INTO `communication` VALUES ('45', '27', '17', '说朋友给他找了一个才一千多元，告诉他可能是模板建站，告诉他模板建站的弊端。说回头再联系一下他朋友 如果不行的话再联系我。', '2011-05-20 10:51:05', '2011-05-20 10:51:05');
INSERT INTO `communication` VALUES ('46', '27', '46', '是一个女的接的 一说是济南的就说不做了  然后就挂了。', '2011-05-20 11:15:04', '2011-05-20 11:15:04');
