INSERT INTO `communication` VALUES ('482', '4', '413', '现在用这个域名www.jaohc.com已经合作是五年的标准网站，包括五年的域名，包括第一年的四个1G的邮箱  价格是6500元 不要发票', '2011-05-26 10:41:29', '2011-05-26 10:41:29');
INSERT INTO `communication` VALUES ('483', '4', '418', '他已经收到三个网络公司的方案，已经把他个人的修改意见反馈到主任那里了，主任一直在出差，还没有回来，给客户面谈过了，需要我们做方案，报价在8万左右就可以', '2011-05-26 10:44:05', '2011-05-26 10:44:05');
INSERT INTO `communication` VALUES ('484', '4', '419', '万网标准建造6500做五年', '2011-05-26 10:45:01', '2011-05-26 10:45:01');
INSERT INTO `communication` VALUES ('485', '4', '421', '客户是做酚醛树脂保温板的，以前有一个网站，现在好久没用了，现在是网站重新制作，没有什么特殊功能，推荐的标准建站，客户想做的关键词优化很难坐上去，推荐的是推广 这个词 酚醛树脂保温板 现在做这个词的比较多，估计费用在一块钱左右，已经约客户来我们公司谈下网站建设的服务   推荐做标准建造', '2011-05-26 10:46:47', '2011-05-26 10:46:47');
INSERT INTO `communication` VALUES ('486', '4', '422', '方案已经发送，对方正在审核，还没有给明确的回复', '2011-05-26 10:47:30', '2011-05-26 10:47:30');
INSERT INTO `communication` VALUES ('487', '4', '423', '方案报价已经发送 ，等待客户通知参加招标', '2011-05-26 10:48:35', '2011-05-26 10:48:35');
INSERT INTO `communication` VALUES ('488', '4', '414', '现在网站是分三部分来做，前期是官方网站制作，二期是网络推广，三期是电子商务的建设，前期是想每一个网络公司都给出一个图，新鸿儒和易思腾不去，现在是中企动力和三五互联和万网的来给他做方案加出效果图，我没有答应，对方已经是做过三十多个网站的了，必须看到首页，看不到不签合同', '2011-05-26 10:51:44', '2011-05-26 10:51:44');
INSERT INTO `communication` VALUES ('489', '4', '415', '现在车间比较忙，还没有忙完，网站是万网的标准建造是6500五年，老板想做提供源代码的，使用300M 空间 600一年是1800 域名三年是300元，网站报价是7360元三年，相当于网站是5260元', '2011-05-26 10:53:26', '2011-05-26 10:53:26');
INSERT INTO `communication` VALUES ('490', '4', '416', '客户想两个网站做到一起，用一个域名，建议他那个网站做在主要网站里面去，体现一个单页面的形式，说了可能标准网站会提价   他想做万网的速成网站 3000做五年', '2011-05-26 10:54:56', '2011-05-26 10:54:56');
INSERT INTO `communication` VALUES ('491', '4', '417', '电话号码已经更改了，客户想做个中文网站，做土工建材的，现在要出差去新疆，五一以后来我们公司，地址和我手机已经发给他了', '2011-05-26 10:55:39', '2011-05-26 10:55:39');
INSERT INTO `communication` VALUES ('492', '4', '424', '客户已经来到过我们公司，李经理帮忙谈的，价格是6万到8万之间，感觉我们的价格高很多暂时不考虑', '2011-05-26 10:57:00', '2011-05-26 10:57:00');
INSERT INTO `communication` VALUES ('493', '4', '425', '客户要过来面谈，客户给的是一个小型的企业网站，现在他需要做的网站是有会员注册的，会员注册以后是两种会员，一种是操盘手，需要认证，认证后有一个单独的网站，一种是需要找操盘手的发布信息，先整理下网站的功能，在联系他，今天他也没时间过来，约下次面谈', '2011-05-26 10:59:23', '2011-05-26 10:59:23');
INSERT INTO `communication` VALUES ('494', '4', '426', '想做一个信息类的平台，就是当地的住家把个人房子出租出去，有两种会员一个是发布出租房子的一个是找房子住的，针对旅游来做的，发邮件把功能定下来，这个网站现在报价是2.5万到3万之间，推广是整合营销，估计费用在10万以内每年的费用   已经给客户发送邮件，等待客户回复邮件，确定网站功能，客户是东北人，可能最近会来我们公司，但是感觉不是很靠谱', '2011-05-26 11:00:20', '2011-05-26 11:00:20');
