INSERT INTO `communication` VALUES ('623', '4', '55', '客户想做一个地方性的行业门户B2B网站，里面要有同行的店铺展示，每天要更新价格，是通过后台来调整的，他从去年就开始考虑这样的事情，前几天来济南看了两个公司，感觉实力上面不是很理想，已经讲了我们每个月都会做五到六个这样的网站，发手机短信给他，约来我们公司面谈下，价格在5万到6万之间', '2011-05-30 10:22:48', '2011-05-30 10:22:48');
