INSERT INTO `communication` VALUES ('722', '4', '423', '你好  请于本月9号上午9点到达我公司进行标书讲解  嘉有肥料西厂区  济南到高唐的车两个小时 车站到我公司打的10分钟车程，现在我要整理邮件，整理我们所需要的内容给他，现在是济南的四家网络公司过去，就是现场谈判的过程，过几天在给通知看是谁来制作这个网站，付款方式上面已经给领导讲过了，但是领导还没有给回复，', '2011-06-02 16:48:38', '2011-06-02 16:48:38');
