INSERT INTO `communication` VALUES ('765', '23', '527', '新公司要做个中英文的网站，做五金机械的，有宣传，搜索，展示，下载（报价），十几在系列产品，要求简洁大方，比较饱满。先发资质和框架发给客户。后续继续跟进。', '2011-06-07 14:21:35', '2011-06-07 14:21:35');
