INSERT INTO `communication` VALUES ('772', '35', '528', '要建一个海鲜类的餐饮网站，给了两个示例网站，欲以此询问报价，发送了相关资料，再联系。', '2011-06-08 09:02:44', '2011-06-08 09:02:44');
INSERT INTO `communication` VALUES ('773', '25', '526', '客户是从事化工产品行业的,公司成立一年左右,现在的营销方式通过业务员的外出.对网站的认知不够,可长期跟进.', '2011-06-08 09:41:16', '2011-06-08 09:41:16');
