INSERT INTO `orders` VALUES ('893', null, '0', null, '904', '6', '61', '24', null, null, null, '2011-08-20 08:00:00', 'http://', null, null, null, null, null, '二、商城：\r\n1、综合页面：购物天堂（分类）、藏品赏析、品牌推荐、会员公寓  \r\n2、购物天堂：汇展导购、乐拍、（4级）          供求    产品框架\r\n3、藏品赏析：收藏天下、专家评鉴（我要鉴定）  （4级）\r\n4、品牌推荐：精品直销、品牌团购、特价专区、      热销排行   \r\n5、会员公寓：家有藏宝（鉴定）、入住商城、藏友乐园（交流、代购、交换）、兴业共赢      个人用户、企业用户   积分、虚拟货币、购物列表、站内关注统计、购物车   商铺的搭建装饰（按月收费）：店铺框架\r\n\r\n根据我们的要求出个大致方案，效果图和报价。\r\n需要量身定做开发\r\n有运营方面的思路和指导吗？', '2011-08-20 11:56:34', '2011-10-25 15:42:25');
INSERT INTO `orders` VALUES ('894', null, '0', null, '905', '6', '61', '25', null, null, null, '2011-08-20 08:00:00', 'http://', null, null, null, null, null, '你好，我要求的网站内容有以下方面：首先说首页上的大导航内容，也就是说父页面的内容有诊疗室，基础医学院，临床医学院，护理医学院，技能学院，养生学院，两性健康，情感驿站，下载专区，专业论坛，我的商城。\r\n注：一，所有父页面的子页面在我学习后能够自己增删，也就是说你做的网站是个空架子，而且是个我自己能够增删子页面的空架子，并且还可以我自己再建子页面的子页面。\r\n二，网站得有如下功能：\r\n1、用户登录注册系统（不登陆注册的用户只有“看”的权利，其他任何权限均需注册登陆后才有，特别注意诊疗室内用户所提交的材料是仅有我和其本人看的到，不同于评论，留言，论坛等等）。\r\n2、访问量显示、设为首页、收藏本站、与我联系。\r\n3、最新动态：格式：【父页面标题】+子页面标题+日期；例如：【临床医学院】高血压2011-08-20；在首页页面内显示15条最新动态，其专有页面内显示的条数分页显示，我在后台视情况自己手动删除；并且最新动态中的动态是自动生成的，例如：我在临床医学院里面增加了一篇高血压的文章，在最新动态里面就自动生成刚才的那个例子，按更新顺序最新的置顶，之前的自动靠下排。\r\n4、专业论坛：同前，子页面我自己增删。\r\n5、下载专区：也要有我自己能增删的子页面，并且此处下载任何文件均需与网上银行系统链接，收费后方可下载这里的文件。\r\n6、我的商城：此处的子页面也要我自己能增删，例如：链接淘宝网的某网店或其它网上商城的网址等。\r\n7、每篇文章的最后都要有评论框，并且还有“转发到或分享到”：QQ空间，人人网...等。\r\n其他：可以接受的价格是1000元，后付费，我自己能做到和别人的网站互联', '2011-08-20 15:14:57', '2011-08-22 08:34:55');
