INSERT INTO `orders` VALUES ('1646', null, '0', null, '1657', '6', '61', '95', null, null, null, '2012-01-31 08:00:00', 'http://', null, null, null, null, null, '我想制作一个服务型的商业网站，寻求网站制作高手 团队。\r\n我的设想：\r\n1：有充值系统，用户可以通过网银、支付宝之类的 充值，充值后直接转化\r\n为网站货币。\r\n2：网站要有内嵌式仿QQ式1对1语音视频聊天系统， 要有仿淘宝式的评价体\r\n系，有几个多功能视频聊天室，视频聊天要能够计时 收费，聊天完毕后自动\r\n跳出评价系统。有完善的计费功能。\r\n3：网站用户主要分为2类，1类充值获得网站货币， 可以有偿使用视频聊天\r\n系统或者有偿进入聊天室，并且可以发送请求帮助； 2类用户通过向1类用户\r\n提供服务获得网站货币，可以查看到1类用户发送的 请求帮助，并且主动联\r\n系1类用户，提供视频聊天帮助。2类用户可以作为聊 天室的主人。2类用户\r\n获得的网站货币和评价要随时可以查看。\r\n4：保证网站的美观、流畅、便捷，并且要有后期升 级的空间。\r\n5：申明：网站所提供的服务方式确实有点和色情服 务类似，网站建完后也和那种网站差不多，但是提供 的服务不同而已，我可以保证不触犯法律不违背道德 。\r\n如果贵公司可以制作这样类型的网站，详细请联系我 ，联系我时，请附上贵\r\n公司的往日经典案例、需要的时间、和你的报价。谢 谢！', '2012-01-31 09:16:26', '2012-02-01 15:38:43');
